import React from 'react'



export default function ProjectsItem() {
    return (
        <div >
            <div className="projects">
                <p> School's Website </p>

                <div className="project-img">
                    <img src={`${window.location.origin}/Images/MorningSunWebsite.png `} alt="" />
                </div>

            </div>

        </div>
    )
}
